import React from "react";
import { speakerData } from "../data"; 

function SpeakerSchedule() {
  return (
    <div className="speaker-schedule-container">
      <h2>Speaker Schedule</h2>
      <ul>
        {speakerData.length > 0 ? (
          speakerData.map((speaker, index) => (
            <li key={index} className="speaker-item">
              <strong>{speaker.name}</strong> - {speaker.topic} ({speaker.time})
            </li>
          ))
        ) : (
          <p>No speakers scheduled yet.</p>
        )}
      </ul>
    </div>
  );
}

export default SpeakerSchedule;
